Defendant Arthur Wilder in court with attorney Debra J Patterson.  Defendant Arthur Wilder in custody.  Kimberly D Schoepp appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.    The Court imposed the following sentence:
 Defendant's TOTAL LENGTH OF SENTENCE shall be 6 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 3 years   with credit for 120 days time served.  Defendant shall serve 3 years on EXTENDED SUPERVISION. The defendant is eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
 * Court ordered defendant to provide a DNA sample.
CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - Serve 7 months condition time at the House of Correction with release to the Day Reporting Center only; NO good time; follow all programming;
 - No contact with Nina O.; Ellie R.; Aaron H.; Charles W.; Tiara J.; Edward H.; Diane R.; Shaun D.; Kongmeng Y.; or Rhonda E.;
 - No contact with MATC located at 1015 North 6th Street, city and county of Milwaukee, Wisconsin;
 - No controlled substances or alcohol;
 - AODA assessment; treatment if needed;
 - Urine screens;
 - Obtain GED;
 - Seek and maintain employment;
 - Job and vocational training;
 - Cognitivite thinking intervention counseling;
 - Pay $1,000.00 stipulated restitution to Aaron H.; pay DNA surcharge, costs, surcharges and disbursements, while on probation.  Should defendant get revoked and be sent to prison, Court ordered monies taken from prison funds not to exceed 25%.  Balance would then be paid while on extended supervision.  Failure to pay amounts in full would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.
